import { configureStore } from '@reduxjs/toolkit'
import newsReducer from '../features/postsSlice'
import provincesReducer from '../features/posts/province/provenceSlice'

export default configureStore({
  reducer: {
    news: newsReducer,
    provinces: provincesReducer
    //users: usersRre voorbeeld

  }
})
